local _mouse = {x=0,y=0,md=0,_x=0,_y,_md,_state="",_pointer = 257,_over = 258,_selected=259}
function _mouse:think()
	self._x = self.x
	self._y = self.y 
	self._md = self.md
	_mouse.x, _mouse.y,_mouse.md = mouse() 
	_mouse.state = "none"
	if self.md == true and self._md==false then
		_mouse.state = "pressed"
	end
	if self.md == false and self._md==true then
		_mouse.state = "released"
	end
	if self.md == true and self._md==true then
		_mouse.state = "held"
	end
end


-- rotating thingy 
function rspr(sx,sy,scale,angle,mx,my,mw,mh,key,useMap)

  --  this is fixed , to make a textured quad
  --  X , Y , U , V
  local sv ={{-1,-1, 0,0},
             { 1,-1, 0.999,0},
             {-1,1,  0,0.999},
             { 1,1,  0.999,0.999}}

	local rp = {} --  rotated points storage

  --  the scale is mw ( map width ) * 4 * scale 
  --  mapwidth is * 4 because we actually want HALF width to center the image
  local scalex = (mw<<2) * scale
  local scaley = (mh<<2) * scale
  --  rotate the quad points
  for p=1,#sv do 
    -- apply scale
    local _sx = sv[p][1] * scalex 
		local _sy = sv[p][2] * scaley
    -- apply rotation
		local a = -angle
		local rx = _sx * math.cos(a) - _sy * math.sin(a)
		local ry = _sx * math.sin(a) + _sy * math.cos(a)
    -- apply transform
    sv[p][1] = rx + sx
    sv[p][2] = ry + sy
    -- scale UV's 
    sv[p][3] = (mx<<3) + (sv[p][3] * (mw<<3))
    sv[p][4] = (my<<3) + (sv[p][4] * (mh<<3))
  end
  -- draw two triangles for the quad
  textri( sv[1][1],sv[1][2],
          sv[2][1],sv[2][2],
          sv[3][1],sv[3][2],
          sv[1][3],sv[1][4],
          sv[2][3],sv[2][4],
          sv[3][3],sv[3][4],
          useMap,key)

  textri( sv[2][1],sv[2][2],
          sv[3][1],sv[3][2],
          sv[4][1],sv[4][2],
          sv[2][3],sv[2][4],
          sv[3][3],sv[3][4],
          sv[4][3],sv[4][4],
          useMap,key)
end



-- make some randos

local bobs = {}
for x=1,500 do
  bobs[x] = {}
  bobs[x].x = math.random(10,220)
  bobs[x].y = math.random(10,100)
  bobs[x].vx = math.random()-0.5
  bobs[x].vy = math.random()-0.5
  bobs[x].spr = math.random(4)//1
  bobs[x].scale = math.random(1,5)
  bobs[x].angle = math.rad(math.random(360))
  bobs[x].clock = math.random(100)/100.0
end

local _DEBUG_ = true

-- performance monitor
----------------------------------------
local perfMon = {stats = {},current = nil}
function perfMon:begin(name)
	if perfMon.stats[name]==nil then
		perfMon.stats[name] = 0
	end
	perfMon.current = name
	perfMon.stats[name] = time()
end
function perfMon:finish()
	perfMon.stats[perfMon.current] = time() - perfMon.stats[perfMon.current]
end
function perfMon:show()
	local sx = 0
	local sy = 130
	local z = 8
  if _DEBUG_ == true then
    for key,value in pairs(perfMon.stats) do
        rect(sx,sy,value*14.20,5,z)
  --            print(key .. " (" .. value .. ")",sx,sy,4)
        print(string.format("%s (%.2f)",key,value),sx,sy,15)
              sy=sy-6
  --			sx=sx+(value*14.20)
        z=z+1
    end
    print(string.format("GC (%.2f) kb",collectgarbage("count")),sx,sy,15)
    collectgarbage("collect")
  end
end

function TIC()
  cls(0)
  _mouse:think()
  local a=math.atan2(120-_mouse.x,68-_mouse.y)
  t = a
  px = _mouse.x
  py = _mouse.y

	perfMon:begin("2tris")

  ep = rspr(px,py, --  x,y
            2,     --  scale
            t,      --  angle
            0,      --  mapX
            2,      --  mapY
            16,      --  mapWidth
            16,      --  mapHeight
            0,      -- color key
            true,
            {
              rotatedPosition={0.5,1.0},
            })

	perfMon:finish()
	perfMon:begin("500bobs")

  for k=1,#bobs do
    bob = bobs[k]
    rspr( bob.x,
          bob.y,          --  x,y
          bob.scale,      --  scale
          bob.angle,      --  angle
          1+(bob.spr*2),  --  mapX
          0,              --  mapY
          2,              --  mapWidth
          2,              --  mapHeight
          14,false)

    --bounce them around 
    bob.x = bob.x + bob.vx
    bob.y = bob.y + bob.vy
    bob.vy = bob.vy + 0.008
    if bob.y>120 then 
      bob.y = 120 
      bob.vy = -1
    end
    if bob.x>240 then 
      bob.x = 240
      bob.vx = -bob.vx
    end
    if bob.x<0 then 
      bob.x = 0
      bob.vx = -bob.vx
    end
    bob.scale = 2+math.sin(bob.clock)
    bob.angle = bob.angle + 0.01
    bob.clock = bob.clock + 0.01
  end

	perfMon:finish()
 spr(16,_mouse.x-4,_mouse.y-4,0)
 --spr(16,ep.mousepos[1]-4,ep.mousepos[2]-4,14)

	perfMon:show()		
end


